ity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2422441","type":"CustomJS"},{"attributes":{"below":[{"id":"2422252"}],"center":[{"id":"2422255"},{"id":"2422259"},{"id":"2422276"}],"height":90,"left":[{"id":"2422256"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"2422281"},{"id":"2422287"}],"sizing_mode":"stretch_width","title":{"id":"2422474"},"toolbar":{"id":"2422268"},"toolbar_location":null,"width":null,"x_range":{"id":"2422057"},"x_scale":{"id":"2422248"},"y_range":{"id":"2422246"},"y_scale":{"id":"2422250"}},"id":"2422244","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"2422118","type":"RedoTool"},{"attributes":{"source":{"id":"2422091"}},"id":"2422282","type":"CDSView"},{"attributes":{"label":{"value":"Trades (1247)"},"renderers":[{"id":"2422368"}]},"id":"2422385","type":"LegendItem"},{"attributes":{},"id":"2422388","type
